import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import API from '../services/api';

const Dashboard = () => {
  const navigate = useNavigate();
  const [stats, setStats] = useState({
    agents: 0,
    lists: 0,
    items: 0
  });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchStats();
  }, []);

  const fetchStats = async () => {
    try {
      const [agentsRes, listsRes] = await Promise.all([
        API.get('/api/agents'),
        API.get('/api/lists')
      ]);
      
      const totalItems = listsRes.data.reduce((sum, list) => sum + list.items.length, 0);
      
      setStats({
        agents: agentsRes.data.length,
        lists: listsRes.data.length,
        items: totalItems
      });
    } catch (error) {
      console.error('Error fetching stats:', error);
    }
    setLoading(false);
  };

  if (loading) {
    return (
      <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '50vh' }}>
        <div className="loading-spinner"></div>
        <span>Loading dashboard...</span>
      </div>
    );
  }

  return (
    <div className="dashboard-container">
      <div className="dashboard-header">
        <h1 className="dashboard-title">Dashboard Overview</h1>
        <div>Welcome to CSTech Management Portal</div>
      </div>

      <div className="dashboard-grid">
        {/* Agents Card */}
        <div className="cstech-card">
          <div className="card-header">
            <h3>Total Agents</h3>
          </div>
          <div className="card-body stat-card">
            <div className="stat-number">{stats.agents}</div>
            <div className="stat-label">Registered Agents</div>
          </div>
        </div>

        {/* Lists Card */}
        <div className="cstech-card">
          <div className="card-header">
            <h3>Uploaded Lists</h3>
          </div>
          <div className="card-body stat-card">
            <div className="stat-number">{stats.lists}</div>
            <div className="stat-label">Customer Lists</div>
          </div>
        </div>

        {/* Items Card */}
        <div className="cstech-card">
          <div className="card-header">
            <h3>Distributed Items</h3>
          </div>
          <div className="card-body stat-card">
            <div className="stat-number">{stats.items}</div>
            <div className="stat-label">Total Items Distributed</div>
          </div>
        </div>
      </div>

      <div className="dashboard-grid">
        {/* Quick Actions Card */}
        <div className="cstech-card">
          <div className="card-header">
            <h3>Quick Actions</h3>
          </div>
          <div className="card-body">
            <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))', gap: '15px' }}>
              <button 
                className="btn-cstech"
                onClick={() => navigate('/agents')}
              >
                Manage Agents
              </button>
              <button 
                className="btn-cstech"
                onClick={() => navigate('/upload')}
              >
                Upload Lists
              </button>
              <button 
                className="btn-cstech"
                onClick={() => navigate('/distributed')}
              >
                View Distribution
              </button>
            </div>
          </div>
        </div>

        {/* Recent Activity Card */}
        <div className="cstech-card">
          <div className="card-header">
            <h3>Recent Activity</h3>
          </div>
          <div className="card-body summary-card">
            <div className="summary-item">
              <span className="summary-label">Last Login</span>
              <span className="summary-value">Today, 10:30 AM</span>
            </div>
            <div className="summary-item">
              <span className="summary-label">Active Sessions</span>
              <span className="summary-value">1</span>
            </div>
            <div className="summary-item">
              <span className="summary-label">System Status</span>
              <span className="summary-value" style={{color: '#28a745'}}>Online</span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
